  namespace: TimeCockpit.Data.DataModel
  summary: "\nRepresents a <xref href=\"TimeCockpit.Data.DataModel.FileProperty\" data-throw-if-not-resolved=\"false\"></xref> in the data model.\n<p>\n<xref href=\"TimeCockpit.Data.DataModel.FileProperty\" data-throw-if-not-resolved=\"false\"></xref>s are actually splitted into four different columns in the database.\nIt actually consists of a file name, a file mime type, the size and the actual content of the property.\nThe <xref href=\"TimeCockpit.Data.DataModel.FileProperty\" data-throw-if-not-resolved=\"false\"></xref> is a kind of wrapper that holds only references to the columns\nvia their name.\n</p>\n<remarks>\nThe creation of a <xref href=\"TimeCockpit.Data.DataModel.FileProperty\" data-throw-if-not-resolved=\"false\"></xref> does not create the other properties that hold, e.g.\nthe name of the size. Users of the framework or a UI need to handle the creation of the according \nproperties.\n</remarks>\n"
  syntax:
    content: >-
      [DataType(typeof(byte[]))]

      [Column(typeof(byte[]), SizePropertyName = "MaxStorageSize")]

      [DefaultValue(new byte[]{})]

      [FriendlyTypeName("Binary")]

      public class FileProperty : BinaryProperty, IDynamicMetaObjectProvider, INotifyPropertyChanged, IDataErrorInfo, INullable
    content.vb: >-
      <DataType(GetType(Byte()))>

      <Column(GetType(Byte()), SizePropertyName:="MaxStorageSize")>

      <DefaultValue(New Byte() {})>

      <FriendlyTypeName("Binary")>

      Public Class FileProperty
          Inherits BinaryProperty
          Implements IDynamicMetaObjectProvider, INotifyPropertyChanged, IDataErrorInfo, INullable
